import React, { useEffect, useState } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./components/screens/Home";

function Main(props) {
  const [loading, setLoading] = useState(false);
  useEffect(() => {
    document.title = "NoQa";
    setLoading(true);
    setTimeout(() => {
      setLoading(false);
    }, 2000);
  }, []);
  return (
    <>
      {/* <BrowserRouter>
        <Routes>
        <Route path={"/"} element={<Home />} />
        </Routes>
      </BrowserRouter> */}

      <div>

        <h1>kiran</h1>
      </div>
    </>
  );
}

export default Main;
